import React, { useState } from "react";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
    useNavigate
} from "react-router-dom";

import Login from "./components/LogIn";
import SignUp from "./components/SignUp";
import ChatUI from "./components/ChatUI";
import DocumentePrestabilite from "./components/DocumentsUI";

function App() {
    // Citim starea iniÈ›ialÄƒ din localStorage
    const [isLoggedIn, setIsLoggedIn] = useState(
        () => localStorage.getItem("isLoggedIn") === "true"
    );

    const handleLogin = () => {
        setIsLoggedIn(true);
        localStorage.setItem("isLoggedIn", "true");
    };

    const handleLogout = () => {
        setIsLoggedIn(false);
        localStorage.removeItem("isLoggedIn");
    };

    return (
        <Router>
            <Routes>
                <Route
                    path="/"
                    element={
                        <MainLayout isLoggedIn={isLoggedIn} onLogout={handleLogout}>
                            <DocumentePrestabilite />
                        </MainLayout>
                    }
                />
                <Route
                    path="/login"
                    element={
                        <MainLayout isLoggedIn={isLoggedIn} onLogout={handleLogout}>
                            <Login onLogin={handleLogin} />
                        </MainLayout>
                    }
                />
                <Route
                    path="/signup"
                    element={
                        <MainLayout isLoggedIn={isLoggedIn} onLogout={handleLogout}>
                            <SignUp onSignUp={handleLogin} />
                        </MainLayout>
                    }
                />
                <Route
                    path="/chat"
                    element={
                        <MainLayout isLoggedIn={isLoggedIn} onLogout={handleLogout}>
                            <ChatUI /> {/* FÄƒrÄƒ verificare de autentificare */}
                        </MainLayout>
                    }
                />
            </Routes>
        </Router>
    );
}

export default App;

// ================= MainLayout =================
function MainLayout({ isLoggedIn, onLogout, children }) {
    const navigate = useNavigate();

    return (
        <div>
            <header
                style={{
                    width: "100%",
                    margin: "0 auto",
                    padding: "20px 30px",
                    display: "flex",
                    justifyContent: "space-between",
                    alignItems: "center",
                    flexWrap: "wrap",
                    boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
                    boxSizing: "border-box",
                    position: "relative",
                    borderRadius: "8px",
                    backgroundColor: "#fff",
                }}
            >
                <h2
                    style={{ cursor: "pointer", margin: "5px 0" }}
                    onClick={() => navigate("/")}
                >
                    AplicaÈ›ia Mea Firebase/React
                </h2>

                <div style={{ display: "flex", gap: "10px", margin: "5px 0" }}>
                    {!isLoggedIn ? (
                        <button
                            onClick={() => navigate("/login")}
                            style={{
                                backgroundColor: "#007bff",
                                border: "none",
                                padding: "8px 16px",
                                color: "white",
                                borderRadius: "6px",
                                cursor: "pointer",
                                minWidth: "80px",
                            }}
                        >
                            Log In
                        </button>
                    ) : (
                        <button
                            onClick={() => {
                                onLogout();
                                navigate("/");
                            }}
                            style={{
                                backgroundColor: "#dc3545",
                                border: "none",
                                padding: "8px 16px",
                                color: "white",
                                borderRadius: "6px",
                                cursor: "pointer",
                                minWidth: "80px",
                            }}
                        >
                            Log Out
                        </button>
                    )}
                </div>

                <button
                    onClick={() => {
                        if (!isLoggedIn) {
                            navigate("/login");
                        } else {
                            navigate("/chat");
                        }
                    }}
                    style={{
                        position: "fixed",
                        bottom: "25px",
                        right: "25px",
                        background: "#6c63ff",
                        border: "none",
                        width: "70px",
                        height: "70px",
                        borderRadius: "50%",
                        color: "white",
                        fontSize: "28px",
                        cursor: "pointer",
                        zIndex: 9999,
                        boxShadow: "0 0 20px rgba(108,99,255,0.8)",
                        transition: "0.25s ease",
                    }}
                    onMouseOver={(e) => {
                        e.target.style.transform = "scale(1.12)";
                        e.target.style.boxShadow = "0 0 25px rgba(108,99,255,1)";
                    }}
                    onMouseOut={(e) => {
                        e.target.style.transform = "scale(1)";
                        e.target.style.boxShadow = "0 0 20px rgba(108,99,255,0.8)";
                    }}
                >
                    ðŸ¤–
                </button>
            </header>

            <main style={{ padding: "20px" }}>{children}</main>
        </div>
    );
}
